import React from 'react';
import logo from './logo.svg';
import './App.css';
import MarkdownRenderer from 'react-markdown-renderer';

function App() {
  const markdown = '# This is a H1  \n## This is a H2  \n###### This is a H6';
  return (
    <MarkdownRenderer markdown={markdown} />
  );
}

export default App;
